    onOpenOneCard:function(vo){
      if((vo.desk_id+'')!==this.gameId){return}
      var id = vo.desk_id;
      var type = vo.type;
      var index;
      var self = this
      var mipaiOpen = self.mipaiOpen;
      var mipai = self.mipai

      if(vo.desk_id==1){
        if (vo.type == 0) {
          mipaiOpen.open_index =  mipaiOpen.x_open_one_index;
          mipaiOpen.x_open_one_index++;
        }else{
          mipaiOpen.open_index = mipaiOpen.z_open_one_index;
          mipaiOpen.z_open_one_index++;
        };
      }else{
        if (vo.type == 0) {
          mipaiOpen.open_index = mipaiOpen.x_open_two_index;
          mipaiOpen.x_open_two_index++;
        }else{
          mipaiOpen.open_index = mipaiOpen.z_open_two_index;
          mipaiOpen.z_open_two_index++;
        };
      }
      index = mipaiOpen.open_index;
      if(!self.desk_pai[vo.desk_id]){
        self.$set(self.desk_pai,vo.desk_id,{left:{},right:{}})
      }
      if(id==1){
        if(type==0){
          if(index==0){
            self.$set(self.desk_pai[vo.desk_id]['left'],'one',mipai.one_x_a +'  _2I7lr 20vY0 ')
            self.$set(self.desk_pai[vo.desk_id]['left'],'two',mipai.one_x_b +'  _2I7lr 20vY0 ')
          }else{
            self.$set(self.desk_pai[vo.desk_id]['left'],'three',mipai.one_x_c +'  _2I7lr 20vY0 ')
          }
        }else{
          if(index==0){
            self.$set(self.desk_pai[vo.desk_id]['right'],'one',mipai.one_z_a +'  _2I7lr 20vY0 ')
            self.$set(self.desk_pai[vo.desk_id]['right'],'two',mipai.one_z_b +'  _2I7lr 20vY0 ')
          }else{
            self.$set(self.desk_pai[vo.desk_id]['right'],'three',mipai.one_z_c +'  _2I7lr 20vY0 ')
          }
        }
      }else{
        if(type==0){
          if(index==0){
            self.$set(self.desk_pai[vo.desk_id]['left'],'one',mipai.two_x_a)
            self.$set(self.desk_pai[vo.desk_id]['left'],'two',mipai.two_x_b)
          }else{
            self.$set(self.desk_pai[vo.desk_id]['left'],'three',mipai.two_x_c )
          }
