    onDeskMembers:function(vo){
      //if(vo.desk_id!==this.gameId){return}
      var self = this
      var userId = self.$store.state.user.id
      
      self.otherUserBets = [];
      self.usersID = [];
      var i = 0;
      var yy = Math.floor(Math.random()*6+0)+1;

      while(i<vo.length-1){
          self.usersID.push(vo[i].id)
          self.otherUserBets.push(vo[i].bets)
          if(self.usersID[i]==userId){
              self.current_user1 = i;
          }else{
            if(yy ==i){
              vo[i].pic =0;
            }
          }
          i++;
      };
      //console.log("游戏桌用户====", vo,self.current_user1)

      if(self.current_user>=vo.length){
        self.current_user=0
      }
      var len = vo.length;
      var arr2 = $.extend(true, [], vo)
      var x = self.current_user1+1;
      var y =  self.current_user+1;
      arr2.splice(x - 1, 1, ... arr2.splice(y - 1, 1,  arr2[x - 1]));
      self.usersID.splice(x - 1, 1, ...self.usersID.splice(y - 1, 1,  self.usersID[x - 1]));
      self.members = arr2
      console.log("游戏桌用户====", self.members,self.current_user)
      game._index = self.current_user+1
      console.log('当前索引',game._index)
    },
   onMemberBet: function (vo){
     //console.log(vo)
    if((vo.desk_id+'')!==this.gameId){return}
    var self = this
    var usersID = self.usersID;
    var otherUserBets = self.otherUserBets;

    if(usersID.indexOf(vo.member_id)!=-1 ){
         //console.log("其他用户下注====",JSON.stringify(vo),"用户位置",usersID.indexOf(vo.member_id))
        var xian,zhuang,he,long,hu,dthe;
       
        var _index = usersID.indexOf(vo.member_id) + 1;

        if(vo.desk_id == 17){ 
          
            if(_index ==this.current_user+1){
              //this.getServerBetInfos({long:vo.long,hu:vo.hu,he:vo.he})
            }

            if(otherUserBets[usersID.indexOf(vo.member_id)].long){
                long = otherUserBets[usersID.indexOf(vo.member_id)].long;
            }else{
                long = 0;  
            }

            if(otherUserBets[usersID.indexOf(vo.member_id)].hu){
                hu = otherUserBets[usersID.indexOf(vo.member_id)].hu;
            }else{
                hu = 0;  
            }
            if(otherUserBets[usersID.indexOf(vo.member_id)].he){
                dthe = otherUserBets[usersID.indexOf(vo.member_id)].he;
            }else{
                dthe = 0;  
            }

            game.otherxiazhu(_index,"bet_long",(vo.long-long));
            game.otherxiazhu(_index,"bet_hu",(vo.hu-hu));
            game.otherxiazhu(_index,"bet_dthe",(vo.dthe-dthe));

            otherUserBets[usersID.indexOf(vo.member_id)].long = vo.long
            otherUserBets[usersID.indexOf(vo.member_id)].hu = vo.hu
            otherUserBets[usersID.indexOf(vo.member_id)].dthe = vo.dthe
        }else{

            if(_index ==this.current_user+1){
//this.getServerBetInfos({zhuang:vo.zhuang,xian:vo.xian,he:vo.he})
            }

            if(otherUserBets[usersID.indexOf(vo.member_id)].xian){
                xian = otherUserBets[usersID.indexOf(vo.member_id)].xian;
            }else{
                xian = 0;
            }
            if(otherUserBets[usersID.indexOf(vo.member_id)].zhuang){
                zhuang = otherUserBets[usersID.indexOf(vo.member_id)].zhuang;
            }else{
                zhuang = 0;
            }
            if(otherUserBets[usersID.indexOf(vo.member_id)].he){
                he = otherUserBets[usersID.indexOf(vo.member_id)].he;
            }else{
                he = 0;  
            }

            game.otherxiazhu(_index,"bet_xian",(vo.xian-xian));
            game.otherxiazhu(_index,"bet_zhuang",(vo.zhuang-zhuang));
            game.otherxiazhu(_index,"bet_he",(vo.he-he));

            otherUserBets[usersID.indexOf(vo.member_id)].he = vo.he;
            otherUserBets[usersID.indexOf(vo.member_id)].zhuang = vo.zhuang
            otherUserBets[usersID.indexOf(vo.member_id)].xian = vo.xian
            }
        }
