    onMember:function (vo){
      //console.log("咪牌用户===="+JSON.stringify(vo),this.gameId)
      // if((vo.desk_id+'')!==this.gameId){return}
      var mipai_zhuang = this.mipai_zhuang
      var mipai_xian = this.mipai_xian
      var desk_status = this.mipai_desk_status
        if(mipai_zhuang&&mipai_xian &&vo.zhuang_member){
            if(mipai_zhuang.id==vo.zhuang_member.id&&mipai_xian.id==vo.xian_member.id){
                return;
            }
        }
        if(vo.zhuang_member!=null){
            if(!mipai_zhuang||mipai_zhuang.id!= vo.zhuang_member.id){
             
                this.shanxianRight(vo.zhuang_member.nickname,formatCurrency(vo.zhuang_member.bet_credit),desk_status);
            }
            mipai_zhuang = vo.zhuang_member;
        }
        if(vo.xian_member!=null){
            if(!mipai_xian||mipai_xian.id!= vo.xian_member.id){
              this.shanxianLeft(vo.xian_member.nickname,formatCurrency(vo.xian_member.bet_credit),desk_status);
            }
            mipai_xian  = vo.xian_member;
        }

        this.mipai_zhuang = mipai_zhuang
        this.mipai_xian = mipai_xian
        
    },
