         var index = this.$store.state.selected_chip_index
          this.chip_num = chips[index]
          this.chip = 'chip-one-'+index
          game.chouma = self.chip_num
      }

      if(self.gameId==17){
        if (self.$store.state.onLHResultHistory.desk_id == this.gameId) {
          self.lhleiji = self.$store.state.onLHResultHistory
        }
      }else{
        if (self.$store.state.onResultHistory.desk_id == this.gameId) {
          self.leiji = self.$store.state.onResultHistory
        }
      }

      self.loadImage()
  },
